INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (40011, 0, "リリ", "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 1, 2, 321, 1, 1, 24001, 125801);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (40011, 0, "クリア", "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 1, 2, 322, 2, 1, 24001, 126001);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (40011, 0, "プレシア", "んーと。\nこれ、あげる。\nはい", 1, 2, 323, 3, 1, 24001, 126101);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (40011, 0, "リリ", "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 1, 2, 324, 4, 2, 24001, 125801);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (40011, 0, "クリア", "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 1, 2, 325, 5, 2, 24001, 126001);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (40011, 0, "プレシア", "お兄。\nきてくれて、うれしい", 1, 2, 326, 6, 2, 24001, 126101);
